import { applyFloatingCornerRadius } from "../utilities/border";
import { backgroundColor } from "../utilities/design-system";
import { applyElevation, ElevationMultiplier } from "../utilities/elevation";
import { highContrastBorder } from "../utilities/high-contrast";
const styles = {
    flyout: Object.assign({ display: "none", background: backgroundColor }, applyFloatingCornerRadius(), applyElevation(ElevationMultiplier.e14), { "z-index": "1", '&[aria-hidden="false"]': {
            display: "block",
        } }, highContrastBorder),
    flyout__top: {},
    flyout__bottom: {},
    flyout__left: {},
    flyout__right: {},
    flyout__horizontalInset: {},
    flyout__verticalInset: {},
};
export default styles;
